function sumArr(t){return t.reduce(function(t,e){return t+e},0)}function formatTime(t){var e=parseInt(t,10),r=Math.floor(e/3600),a=Math.floor((e-3600*r)/60),n=e-3600*r-60*a;return 10>a&&(a="0"+a),10>n&&(n="0"+n),r+"<small> h</small> "+a+"<small> m</small> "}Date.prototype.getWeek=function(){var t=new Date(this.getFullYear(),0,1);return Math.ceil(((this-t)/864e5+t.getDay()+1)/7)};